INSERT INTO `cc_project_property` VALUES ('071ddded0600483b82f62bf8e10e5874', 'log4j.rootLogger=${logger_level}, stdout, R\r\nlog4j.appender.stdout=org.apache.log4j.ConsoleAppender\r\nlog4j.appender.stdout.layout=org.apache.log4j.PatternLayout\r\n\r\nlog4j.logger.org.apache.commons.httpclient=info\r\nlog4j.logger.httpclient.wire.content=info\r\nlog4j.logger.httpclient.wire.header=info\r\n\r\n# Pattern to output the caller\'s file name and line number.\r\nlog4j.appender.stdout.layout.ConversionPattern=%-4r %-5p [%d{yyyy-MM-dd HH:mm:ss}]  %m%n\r\n\r\nlog4j.appender.R=org.apache.log4j.RollingFileAppender\r\nlog4j.appender.R.File=${logger_file}\r\nlog4j.appender.R.MaxFileSize= 100MB\r\n\r\n# Keep one backup file\r\nlog4j.appender.R.MaxBackupIndex=1\r\n\r\nlog4j.appender.R.layout=org.apache.log4j.PatternLayout\r\nlog4j.appender.R.layout.ConversionPattern=%-4r %-5p [%d{yyyy-MM-dd HH:mm:ss}]  %m%n\r\nlog4j.appender.LOGFILE.encoding=UTF-8', 'ISO-8859-1', 'log4j.properties', 'JXC');
