INSERT INTO `cc_project_property` VALUES ('7052d8a5bf564206858b294a94ab0cb2', '# connect timeout in seconds\r\n# default value is 30s\r\nconnect_timeout=15\r\n\r\n# network timeout in seconds\r\n# default value is 30s\r\nnetwork_timeout=60\r\n\r\n# the base path to store log files\r\nbase_path=${fastdfs_base_path}\r\n\r\n# tracker_server can ocur more than once, and tracker_server format is\r\n#  \"host:port\", host can be hostname or ip address\r\ntracker_server=${fastdfs_tracker_server_address1}:${fastdfs_tracker_server_port}\r\n${fastdfs_double}tracker_server=${fastdfs_tracker_server_address2}:${fastdfs_tracker_server_port}\r\n\r\n\r\n#standard log level as syslog, case insensitive, value list:\r\n### emerg for emergency\r\n### alert\r\n### crit for critical\r\n### error\r\n### warn for warning\r\n### notice\r\n### info\r\n### debug\r\nlog_level=info\r\n\r\n# if use connection pool\r\n# default value is false\r\n# since V4.05\r\nuse_connection_pool = true\r\n\r\n# connections whose the idle time exceeds this time will be closed\r\n# unit: second\r\n# default value is 3600\r\n# since V4.05\r\nconnection_pool_max_idle_time = 3600\r\n\r\n# if load FastDFS parameters from tracker server\r\n# since V4.05\r\n# default value is false\r\nload_fdfs_parameters_from_tracker=false\r\n\r\n# if use storage ID instead of IP address\r\n# same as tracker.conf\r\n# valid only when load_fdfs_parameters_from_tracker is false\r\n# default value is false\r\n# since V4.05\r\nuse_storage_id = false\r\n\r\n# specify storage ids filename, can use relative or absolute path\r\n# same as tracker.conf\r\n# valid only when load_fdfs_parameters_from_tracker is false\r\n# since V4.05\r\nstorage_ids_filename = storage_ids.conf\r\n\r\n\r\n#HTTP settings\r\nhttp.tracker_server_port=${fastdfs_http.tracker_server_port}\r\n\r\n#use \"#include\" directive to include HTTP other settiongs\r\n##include http.conf', 'ISO-8859-1', 'fastdfs_client.conf', 'HSL-H5');
